import React from 'react';

export default function Notification() {
  return (
    <div className="flex items-center justify-center">
      <div className="w-[1800px] h-[750px] mt-4 rounded-3xl bg-gray-100 bg-opacity-30">
        <div className="grid grid-cols-1 gap-5 p-6 overflow-y-auto h-[650px]">
          {Array(6).fill(0).map((_, index) => (
            <div key={index} className="flex items-center justify-between bg-white rounded-2xl p-4">
              <div className="flex items-center">
                <div className="font-semibold ml-20">Cửa hàng *Tên cửa hàng* đã phản hồi đánh giá của bạn</div>
              </div>
              <div className="flex items-center justify-center bg-[#7CD0FF] rounded-r-2xl h-full w-[120px]">
                <button className="text-center text-white">Xem</button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
